{'sdk_element_id': 'BT-201-Contract', 'sdk_element_title': 'Modification Reason Description', 'sdk_element_xpath': '/*/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'test_data_xpaths': [{'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9da', 'test_data_id': '607008-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': "Een volledige afsluiting voor regulier onderhoud is niet opgenomen in de oorspronkelijke stukken. De algemene aard van de opdracht veranderd niet. De wijziging is noodzakelijk geworden om de juiste niveau van veiligheid te handhaven. Verandering van opdrachtnemer is niet mogelijk vanwege contractuele bepalingen die voorzien in samenwerking met n opdrachtnemer tot het einde van het contract. Binnen DBFM is het niet gewenst om te veranderen van opdrachtnemer. Dit kan leiden tot aanzienlijke kostenstijging. De huidige opdrachtnemer heeft diepgaande kennis van het project, wat problemen bij de overdracht van informatie voorkomt en verantwoordelijkheden duidelijk houdt, waardoor juridische en financile risico's worden verminderd. Daarnaast waarborgt de opdrachtnemer de kwaliteit in alle fasen, inclusief onderhoud. Vervanging leidt vaak tot inefficinties, hogere kosten en cordinatieproblemen."}]}, {'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9de', 'test_data_id': '616516-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Er is sprake van een dwingende spoed in verband met een niet-acceptabel risico met betrekking tunnelveiligheid, bereikbaarheid en doorstroming. De KWA tunnel moet blijvend voldoen aan de gestelde kaders, regels en wetgeving.'}]}, {'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9eb', 'test_data_id': '588659-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Avenant 2 au march 5392 MILECLAIR'}]}, {'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9ed', 'test_data_id': '598960-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:ChangeReason/efbc:ReasonDescription', 'value': 'Aneks nr 12 z dnia 30.09.2024 r. - W zwizku ze stwierdzeniem koniecznoci zaniechania czci robt i wykonania robt dodatkowych oraz rozszerzajcych zakres,  ktrych nie mona byo przewidzie na etapie opracowywania dokumentw wyjciowych niezbdnych do realizacji zadania, w celu wykonania penego zakresu zadania okrelonego w zatwierdzonym Programie Inwestycji, na podstawie:
1)	Protokou koniecznoci Nr 26/51148/19/2024, zatwierdzonego w dniu 15.07.2024 r.  - prace objte zakresem przedmiotowego Protokou koniecznoci - Instalacje elektryczne sieci zewntrzne, instalacje elektryczne, instalacje telekomunikacyjne - instalacje i systemy teletechniczne, system alarmowy SSWIN, system sygnalizacji poarowej SSP, telewizyjny system nadzoru CCTV, system kontroli dostpu SKD, system wykrywania wglowodorw i etanolu; 
2)	Protokou koniecznoci Nr 31/51148/20/2024, z zakresem rzeczowym zatwierdzonym w dniu 19.09.2024 r. - prace objte zakresem przedmiotowego Protokou koniecznoci - Instalacje paliwowe, bud nr 01, 02, 06 i 09 - architektura i konstrukcja, bocznica kolejowa, drogi, instalacje i sieci sanitarne;
3)	Protokou koniecznoci Nr 33/51148/21/2024, zatwierdzonego w dniu 23.09.2024 r.  - prace objte zakresem przedmiotowego Protokou koniecznoci s zaleceniami do wykonania wynikajcymi z przeprowadzonych w dniach 23  31.07.2024 r. przez Delegatur Wojskowej Ochrony Przeciwpoarowej w Lublinie czynnoci kontrolno-rozpoznawczych zwizanych z ochron ppo. skadu MPS (notatka z dnia 01.08.2024 r.) zwikszono wynagrodzenie wykonawcy - zmiana na podstawie art. 455 ust. 1 pkt 1 i pkt 4 ustawy z dnia 11 wrzenia 2019 r. Prawo zamwie publicznych.'}]}], 'is_covered': True, 'xpath_conditions': [{'xpath_condition': '', 'meets_xpath_condition': True}], 'message': None}

{'sdk_element_id': 'BT-202-Contract', 'sdk_element_title': 'Modification Description', 'sdk_element_xpath': '/*/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'test_data_xpaths': [{'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9da', 'test_data_id': '607008-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'Op het DBFM traject A27/A1 zijn de laatste jaren meerdere malen (16-06-2020 incident met RWS voertuig en 23-11-2023 aanrijding bots-voertuig) incidenten geweest waarbij een vrachtwagen is ingereden op een of meerdere (werk)voertuigen. Daarbij is gebleken dat werken achter een (rijdende) afzetting volgens de vigerende regelgeving en ondersteund middels rode kruizen boven de weg de veiligheid nog onvoldoende gegarandeerd is. In lijn met de strategie die ON dient te volgen, en waarbij RWS graag bijdraagt/ondersteunt om de veiligheid te verbeteren, is er afgesproken om samen met de marktpartij (in dit geval 3Angle) te onderzoeken of werkzaamheden veiliger kunnen worden uitgevoerd. Rijkswaterstaat ziet het als haar verantwoordelijkheid (EVA) om bij te dragen aan een veilig werkklimaat op haar areaal.'}]}, {'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9de', 'test_data_id': '616516-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': 'Tussen de PLC en CIM servers (die de interfacing verzorgen met Intercom, Omroep en CCTV) valt soms de communicatie weg . Het retry-mechanisme dat gemplementeerd is om de communicatie te herstellen is echter niet robuust genoeg waardoor in sommige gevallen de communicatie niet automatisch hersteld kan worden en handmatig herstel van de verbinding nodig is.  Dit probleem is sinds de aanleg van KWA tunnel (A2/N2) aanwezig, maar inmiddels is er een oplossing bedacht die de opdrachtgever graag gemplementeerd ziet worden. De oplossing zorgt voor automatisch herstel, waardoor kortstondige uitval van de communicatie niet langer leidt tot het niet-bedienbaar zijn van het opject.
Opdrachtgever wenst deze modificatie ten laatste in 2025 gemplementeerd te hebben in de KWA tunnel. Middels deze VTW willen wij deze werkzaamheden aan opdrachtnemer opdragen.'}]}, {'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9eb', 'test_data_id': '588659-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': "Avenant 2 au march 5392 MILECLAIR - Adjonction d'un groupe"}]}, {'test_data_suite_oid': '67feb44edca42e57948af9d9', 'test_data_suite_id': 'sampling_eforms_all_can-1.12', 'test_data_oid': '67feb44edca42e57948af9ed', 'test_data_id': '598960-2024', 'xpaths': [{'xpath': 'ContractAwardNotice/ext:UBLExtensions/ext:UBLExtension/ext:ExtensionContent/efext:EformsExtension/efac:ContractModification/efac:Change/efbc:ChangeDescription', 'value': '1. W zwizku ze stwierdzeniem koniecznoci zaniechania czci robt i wykonania robt dodatkowych oraz rozszerzajcych zakres,  ktrych nie mona byo przewidzie na etapie opracowywania dokumentw wyjciowych niezbdnych do realizacji zadania, w celu wykonania penego zakresu zadania okrelonego w zatwierdzonym Programie Inwestycji, na podstawie:
